import React from 'react';
import classes from "../Input/Input.module.css"

const Select = ({props}) => {
    return (
        <div className={classes.input}>
            <select placeholder={props}>
                <option>1</option>
                <option>1</option>
                <option>1</option>
            </select>
        </div>
    );
};

export default Select;
